import { Redirect, Route } from "react-router-dom";
import LoginMod from "../components/modals/LoginMod";
const Private = ({ component: Component, ...rest }) => {
  const login = false;

  return (
    <>
      <Route
        {...rest}
        render={(props) =>
          login ? <Component {...props} /> : <LoginMod handleShow={true} />
        }
      />
    </>
  );
};

export default Private;
